"""
    525. Contiguous Array
    https://leetcode.com/problems/contiguous-array/?tab=Description
"""

class Solution(object):
    def findMaxLength(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        dic = {0: 0}
        count = 0
        res = 0
        for i in range(len(nums)):
            if nums[i] == 0:
                count -= 1
            else:
                count += 1

            if count in dic:
                res = max(res, i + 1- dic[count])
            else:
                dic[count] = i + 1

        return res

